pragma solidity >= 0.5.0 < 0.7.0;
contract decentralized_storage{

struct upload_file{


	uint upload_file_id;
	uint user_id;
	uint system_details_first_id;
	uint system_details_second_id;
	string title;
	string system_one;
	string system_two;
	string part_one;
	string part_two;
	string date;




}


upload_file []fu;


function add_upload_file(uint upload_file_id,
	uint user_id,uint system_details_first_id,uint system_details_second_id,

	string memory title,
	string memory system_one,
	string memory system_two,string memory part_one,string memory part_two,
	string memory date)
	public
	{
	upload_file memory f1=upload_file(upload_file_id,user_id,system_details_first_id,system_details_second_id,title,system_one,system_two,part_one,part_two,date);
	fu.push(f1);
	}



}
